//import './App.css';
import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

/////////////////////////////////////////////////////// M-ui
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';

/////////////////////////////////////////////////////// File
import Search from './Search'
import LoginPaper from './ComponentLogin/LoginPaper'
import Add from '../../Component/PageDashboard/Add'
import ReactQrCodeScanner from './ReactQrCodeScanner'

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    margin: '10px'
  },
  Navbar: {
    padding: theme.spacing(6),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  Main: {
    padding: theme.spacing(6),
    textAlign: 'center',
    color: theme.palette.text.secondary,
    height: 660 ,
    flexDirection: 'row',
    display: 'flex',
  },
  PaperL: {
    padding: theme.spacing(1),
    height: 350 ,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  PaperR: {
    padding: theme.spacing(1),
    height: 350 ,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  Button: {
    '& > *': {
      margin: theme.spacing(1),
      padding: '20px',
      margin: '4px',
      position: 'relative',
      justify: 'space-evenly'
    },
  logout: {
    marginTop: '50px',
  }
  },
  rootBtn: {
    '& > *': {
      margin: theme.spacing(0),
    },display: 'flex'
  },
}));

function Dasboard() {
  const classes = useStyles();

  return (
    <Router>
      <div className="App">
        <div className={classes.root}>
          <Grid container spacing={3}>
            <Grid item xs={3}>
            <Paper className={classes.PaperL}>
              <LoginPaper />
            </Paper>
            </Grid>
            <Grid item xs={9}>
              <Paper className={classes.PaperR}>
                <Grid item xs={12}>
                  
                </Grid>
              </Paper>
            </Grid>
            <Grid item xs={12}>
              <Paper className={classes.Main}>
                <Grid item xs={3} spacing={3}>
                  <Add />
                  <Grid item xs={10}>
                  <div className={classes.rootBtn}>
                    <Button fullWidth variant="contained" color="secondary" > 
                      Withdraw 
                    </Button>
                    <Button  fullWidth variant="contained" color="Primary" > 
                      To Store  
                    </Button>
                  </div>
                  </Grid>
                </Grid>
                <Grid item xs={9}>
                  <Search /> 
                </Grid>
              </Paper>
            </Grid>
          </Grid>
        </div>
      </div>
    </Router>
  );
}


export default Dasboard;
